  {session_token: "DTuegpJzhstHa1UIO0kKuA==", password_digest: "$2a$10$Q2KsaG4ZB8LXEnV/biyDIeK5QnUgUX9W2LVnLzhTT7KddY2C/5C.C", username: "Bottom", email: "assface@mechanics.com", age: 30, zip_code: 2139, gender: 1, orientation: 2, ethnicity: 7, height: nil, body_type: 1, diet: 2, smokes: 3, drinks: 2, drugs: 3, religion: 2, sign: 2, education: 2, job: 1, income: 2, relationship_status: 1, relationship_type: 1, offspring: 1, pets: 1, min_age: 0, max_age: 100, looking_for_status: 3, is_looking_for_men: false, is_looking_for_women: true, is_looking_for_friends: true, is_looking_for_ltdating: true, is_looking_for_stdating: false, is_looking_for_sexitimes: false, essay1: "Don't judge a book by its cover. Or its huge donkey head, yanno, same diff.", essay2: "Messing around, doing some acting with my bros - currently in a tedious, brief production of Pyramus and Thisby. Will be playing Pyramus, obvi.", essay3: nil, essay4: nil, essay5: "", essay6: nil, essay7: "Chillin' with the fairy queen.", essay8: "You've ever been enamored of an ass.", avatar_id: 25},
  {session_token: "/6XcaU4X8IMwOkjRlv6BAA==", password_digest: "$2a$10$n0kmJrOCIeNgwTIH7eGLsuADDSipHuDNFhlEf1xdgP9yrixMwxFMW", username: "Titania", email: "fairy@queen.com", age: 100, zip_code: 2139, gender: 3, orientation: 3, ethnicity: 3, height: nil, body_type: 2, diet: 3, smokes: 2, drinks: 1, drugs: 1, religion: 8, sign: 5, education: 1, job: 2, income: 2, relationship_status: 2, relationship_type: 4, offspring: 1, pets: 5, min_age: 20, max_age: 100, looking_for_status: 3, is_looking_for_men: true, is_looking_for_women: true, is_looking_for_friends: true, is_looking_for_ltdating: true, is_looking_for_stdating: true, is_looking_for_sexitimes: true, essay1: "I am the fairy queen. NBD", essay2: "", essay3: nil, essay4: "", essay5: nil, essay6: "Getting back at my ex. He's a total jerk and he's trying to steal my kid.", essay7: "Crazy story...", essay8: "You are part donkey.", avatar_id: 18},
  {session_token: "qkJN93R0igq/WKwJWHq9Aw==", password_digest: "$2a$10$E3IQtpXGnCtqFJFQKeGOku2cGlZEoxh4br2yt.i4aLEvljbU36zp6", username: "Puck", email: "robin.goodfellow@fairies.com", age: 25, zip_code: 2139, gender: 3, orientation: 4, ethnicity: 0, height: nil, body_type: 4, diet: 1, smokes: 4, drinks: 5, drugs: 2, religion: 2, sign: 10, education: 1, job: 2, income: 1, relationship_status: 1, relationship_type: 4, offspring: 1, pets: 1, min_age: 0, max_age: 100, looking_for_status: 3, is_looking_for_men: true, is_looking_for_women: true, is_looking_for_friends: true, is_looking_for_ltdating: false, is_looking_for_stdating: false, is_looking_for_sexitimes: false, essay1: "I am that merry wanderer of the night!", essay2: "I jest to Oberon and make him smile \r\nWhen I a fat and bean-fed horse beguile, \r\nNeighing in likeness of a filly foal: \r\nAnd sometime lurk I in a gossip's bowl, \r\nIn very likeness of a roasted crab, \r\nAnd when she drinks, against her lips I bob \r\nAnd on her wither'd dewlap pour the ale. \r\nThe wisest aunt, telling the saddest tale, \r\nSometime for three-foot stool mistaketh me;\r\nThen slip I from her bum, down topples she, \r\nAnd 'tailor' cries, and falls into a cough; \r\nAnd then the whole quire hold their hips and laugh, \r\nAnd waxen in their mirth and neeze and swear \r\nA merrier hour was never wasted there. ", essay3: "Looking like a roasted crab.", essay4: "", essay5: "", essay6: "Mischief", essay7: "Drugging random people in the woods.", essay8: "", avatar_id: 32},
  {session_token: "tx25DHh7nlCkb97NSZM3zA==", password_digest: "$2a$10$LQooYMBtC9vG8wifwNYoFeEvzVEHrhBof92DXuuqXidChwts7Wqgy", username: "Hamlet", email: "hamlet@crazy.net", age: 20, zip_code: 2139, gender: 1, orientation: 2, ethnicity: 1, height: nil, body_type: 3, diet: 6, smokes: 4, drinks: 5, drugs: 0, religion: 0, sign: 3, education: 5, job: 2, income: 1, relationship_status: 3, relationship_type: 1, offspring: 2, pets: 2, min_age: 20, max_age: 40, looking_for_status: 2, is_looking_for_men: false, is_looking_for_women: true, is_looking_for_friends: false, is_looking_for_ltdating: true, is_looking_for_stdating: false, is_looking_for_sexitimes: false, essay1: "To be, or not to be--that is the question:\r\nWhether 'tis nobler in the mind to suffer\r\nThe slings and arrows of outrageous fortune\r\nOr to take arms against a sea of troubles\r\nAnd by opposing end them. To die, to sleep--\r\nNo more--and by a sleep to say we end\r\nThe heartache, and the thousand natural shocks\r\nThat flesh is heir to. 'Tis a consummation\r\nDevoutly to be wished. To die, to sleep--\r\nTo sleep--perchance to dream: ay, there's the rub,\r\nFor in that sleep of death what dreams may come\r\nWhen we have shuffled off this mortal coil,\r\nMust give us pause. There's the respect\r\nThat makes calamity of so long life.\r\nFor who would bear the whips and scorns of time,\r\nTh' oppressor's wrong, the proud man's contumely\r\nThe pangs of despised love, the law's delay,\r\nThe insolence of office, and the spurns\r\nThat patient merit of th' unworthy takes,\r\nWhen he himself might his quietus make\r\nWith a bare bodkin? Who would fardels bear,\r\nTo grunt and sweat under a weary life,\r\nBut that the dread of something after death,\r\nThe undiscovered country, from whose bourn\r\nNo traveller returns, puzzles the will,\r\nAnd makes us rather bear those ills we have\r\nThan fly to others that we know not of?\r\nThus conscience does make cowards of us all,\r\nAnd thus the native hue of resolution\r\nIs sicklied o'er with the pale cast of thought,\r\nAnd enterprise of great pitch and moment\r\nWith this regard their currents turn awry\r\nAnd lose the name of action. -- Soft you now,\r\nThe fair Ophelia! -- Nymph, in thy orisons\r\nBe all my sins remembered.", essay2: "Avenging my dad and stuff.", essay3: "Soliloquizing", essay4: "", essay5: "", essay6: "Poor Yorik. I knew him.", essay7: "", essay8: "You're definitely not gonna drown yourself in a pond. Srsly.", avatar_id: 33},
  {session_token: "cecy72iT1pnOx/iZ8JSWrg==", password_digest: "$2a$10$BmSfABPFHGne4o7mv.qQIelPyOCvivjIrnUcJr51lm6.sNT2upVqe", username: "Ophelia", email: "ophelia@appacademy.io", age: 17, zip_code: 2139, gender: 2, orientation: 3, ethnicity: 1, height: nil, body_type: 3, diet: 5, smokes: 4, drinks: 5, drugs: 1, religion: 1, sign: 11, education: 4, job: 2, income: 2, relationship_status: 3, relationship_type: 1, offspring: 2, pets: 3, min_age: nil, max_age: nil, looking_for_status: 1, is_looking_for_men: true, is_looking_for_women: false, is_looking_for_friends: false, is_looking_for_ltdating: true, is_looking_for_stdating: true, is_looking_for_sexitimes: false, essay1: "Just your average damsel in distress. You probably wouldn't really care that much if I died.", essay2: "Hanging out, being a plot device.", essay3: "", essay4: "", essay5: "", essay6: "Why Hamlet is acting so totally weird all of a sudden. Like, seriously, what gives?", essay7: "", essay8: "You're not violent and haunted by the ghost of your dead father. I'm like so over that.", avatar_id: 46},
  {session_token: "wKHrgnCBvOIawjEncze/BA==", password_digest: "$2a$10$42.91e0iB37eaYwbwuFjE.uV399lpoV/aPy6ZDfPT5JMpVdNW9Rbi", username: "Juliet", email: "j.capulet@twohouses.com", age: 14, zip_code: 2139, gender: 2, orientation: 2, ethnicity: 1, height: nil, body_type: 2, diet: 6, smokes: 3, drinks: 4, drugs: 1, religion: 3, sign: 11, education: 8, job: 1, income: 1, relationship_status: 2, relationship_type: 2, offspring: 2, pets: 4, min_age: 18, max_age: 30, looking_for_status: 3, is_looking_for_men: true, is_looking_for_women: false, is_looking_for_friends: false, is_looking_for_ltdating: false, is_looking_for_stdating: true, is_looking_for_sexitimes: true, essay1: "O Romeo, Romeo! wherefore art thou Romeo?\r\nDeny thy father and refuse thy name;\r\nOr, if thou wilt not, be but sworn my love,\r\nAnd I'll no longer be a Capulet.", essay2: "Moping, mostly.", essay3: "Planning foolproof ways to be reunited with my banished love (but actually not really).", essay4: nil, essay5: nil, essay6: "Romeo, roses.", essay7: "On the balcony, yanno, pining.", essay8: "Your blank verse is impeccable.", avatar_id: 4},
  {session_token: "I4K0K+63oef5GgthZho5fQ==", password_digest: "$2a$10$R.231iYymmuSqe9XlgZG..VS5IWQG7lj7szdGN2KA0A3qyMkPXdKC", username: "Romeo", email: "r.montague@twohouses.com", age: 18, zip_code: 2139, gender: 1, orientation: 2, ethnicity: 6, height: nil, body_type: 3, diet: 4, smokes: 3, drinks: 2, drugs: 3, religion: 8, sign: 11, education: 8, job: 2, income: 2, relationship_status: 2, relationship_type: 2, offspring: 2, pets: 4, min_age: 15, max_age: 20, looking_for_status: 2, is_looking_for_men: false, is_looking_for_women: true, is_looking_for_friends: false, is_looking_for_ltdating: false, is_looking_for_stdating: true, is_looking_for_sexitimes: true, essay1: "But, soft! what light through yonder window breaks?\r\nIt is the east, and Juliet is the sun.\r\nArise, fair sun, and kill the envious moon,\r\nWho is already sick and pale with grief,\r\nThat thou her maid art far more fair than she:\r\nBe not her maid, since she is envious;\r\nHer vestal livery is but sick and green\r\nAnd none but fools do wear it; cast it off.\r\nIt is my lady, O, it is my love!\r\nO, that she knew she were!\r\nShe speaks yet she says nothing: what of that?\r\nHer eye discourses; I will answer it.\r\nI am too bold, 'tis not to me she speaks:\r\nTwo of the fairest stars in all the heaven,\r\nHaving some business, do entreat her eyes\r\nTo twinkle in their spheres till they return.\r\nWhat if her eyes were there, they in her head?\r\nThe brightness of her cheek would shame those stars,\r\nAs daylight doth a lamp; her eyes in heaven\r\nWould through the airy region stream so bright\r\nThat birds would sing and think it were not night.\r\nSee, how she leans her cheek upon her hand!\r\nO, that I were a glove upon that hand,\r\nThat I might touch that cheek!", essay2: "Crashing parties! Also family feuds take up a considerable amount of my spare time.", essay3: "Accidentally getting my friends killed. Oops", essay4: "Love italian food : )", essay5: "My bffl Mercutio, my sword, Juliet, a very discrete clergyman, family, a good apothecary", essay6: "Rosal... I mean Juliet.", essay7: "Creeping under balconies.", essay8: "Thou art thou art\r\nAs glorious to this night, being o'er my head\r\nAs is a winged messenger of heaven\r\nUnto the white-upturned wondering eyes\r\nOf mortals that fall back to gaze on him\r\nWhen he bestrides the lazy-pacing clouds\r\nAnd sails upon the bosom of the air.", avatar_id: 9}
])
